USE master
GO

IF EXISTS(SELECT 1 FROM sys.databases WHERE name LIKE 'MiLogistic') BEGIN
	DROP DATABASE MiLogistic
END

CREATE DATABASE MiLogistic
GO

USE MiLogistic
GO

IF EXISTS(SELECT 1 FROM sys.tables WHERE name LIKE 'Existencia') BEGIN
	DROP TABLE Existencia
END

CREATE TABLE Existencia (
	Bodega VARCHAR(15) NOT NULL,
	NomBodega VARCHAR(255) NOT NULL,
	Bin VARCHAR(30) NOT NULL,
	Propietario VARCHAR(30) NOT NULL,
	FechaAlmacenaje DATETIME NOT NULL,
	CodArt VARCHAR(30) NOT NULL,
	Serie VARCHAR(30) NOT NULL,
	Placa VARCHAR(30) NULL,
	Modelo VARCHAR(30) NULL,
	Denominacion VARCHAR(255) NOT NULL,
	Marca VARCHAR(30) NULL,
	Referencia VARCHAR(30) NULL
)

